// components/HeroSection.js
import React, { useState } from 'react';
import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBIcon,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBCollapse,
  MDBInput,
  MDBBtn,
} from 'mdb-react-ui-kit';
import { Link } from 'react-router-dom'; // Import Link for navigation
import './HeroSection.css';

const HeroSection = ({ handleSearch, suggestions }) => {
  const [openBasic, setOpenBasic] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');

  const renderSuggestions = () => {
    return suggestions.map((suggestion, index) => (
      <div key={index} className="suggestion-item">
        {suggestion}
      </div>
    ));
  };

  return (
    <MDBNavbar expand='lg' light bgColor='light' className="hero-section">
      <MDBContainer fluid>
        {/* Logo on the Left */}
        <MDBNavbarBrand href='#'>
          <img src={require('./logo.png')} alt='DripSync Logo' className='logo' />
        </MDBNavbarBrand>

        {/* Toggler for mobile view */}
        <MDBNavbarToggler
          aria-controls='navbarSupportedContent'
          aria-expanded={openBasic}
          aria-label='Toggle navigation'
          onClick={() => setOpenBasic(!openBasic)}
        >
          <MDBIcon icon='bars' fas />
        </MDBNavbarToggler>

        <MDBCollapse navbar show={openBasic}>
          {/* Navbar Links and Dropdowns Right-Aligned */}
          <MDBNavbarNav className='ms-auto mb-2 mb-lg-0 align-items-center'>
            {/* Dropdown Men */}
            <MDBNavbarItem>
              <MDBDropdown>
                <MDBDropdownToggle tag='a' className='nav-link' role='button'>
                  Men
                </MDBDropdownToggle>
                <MDBDropdownMenu>
                  <MDBDropdownItem link>Topwear</MDBDropdownItem>
                  <MDBDropdownItem link>Bottomwear</MDBDropdownItem>
                </MDBDropdownMenu>
              </MDBDropdown>
            </MDBNavbarItem>

            {/* Dropdown Women */}
            <MDBNavbarItem>
              <MDBDropdown>
                <MDBDropdownToggle tag='a' className='nav-link' role='button'>
                  Women
                </MDBDropdownToggle>
                <MDBDropdownMenu>
                  <MDBDropdownItem link>Topwear</MDBDropdownItem>
                  <MDBDropdownItem link>Bottomwear</MDBDropdownItem>
                </MDBDropdownMenu>
              </MDBDropdown>
            </MDBNavbarItem>

            {/* Dropdown Gen Z */}
            <MDBNavbarItem>
              <MDBDropdown>
                <MDBDropdownToggle tag='a' className='nav-link' role='button'>
                  Gen Z
                </MDBDropdownToggle>
                <MDBDropdownMenu>
                  <MDBDropdownItem link>Streetwear</MDBDropdownItem>
                  <MDBDropdownItem link>Vintage</MDBDropdownItem>
                </MDBDropdownMenu>
              </MDBDropdown>
            </MDBNavbarItem>

            {/* Dropdown Personalized */}
            <MDBNavbarItem>
              <MDBDropdown>
                <MDBDropdownToggle tag='a' className='nav-link' role='button'>
                  Personalized
                </MDBDropdownToggle>
                <MDBDropdownMenu>
                  <MDBDropdownItem link>Topwear</MDBDropdownItem>
                  <MDBDropdownItem link>Bottomwear</MDBDropdownItem>
                </MDBDropdownMenu>
              </MDBDropdown>
            </MDBNavbarItem>


            {/* Search Bar */}
            <MDBNavbarItem className="search-container ms-3">
              <form className='d-flex input-group w-auto position-relative'>
                <MDBInput
                  label='Search for products...'
                  id='search'
                  type='text'
                  value={searchQuery}
                  onChange={(e) => {
                    setSearchQuery(e.target.value);
                    handleSearch(e.target.value);
                  }}
                  className="search-input"
                />
                <MDBBtn color='primary' className="ms-2">Search</MDBBtn>
                {searchQuery && (
                  <div className="search-suggestions position-absolute bg-white border rounded mt-2 p-2" style={{ zIndex: 1000, width: '100%' }}>
                    {renderSuggestions()}
                  </div>
                )}
              </form>
            </MDBNavbarItem>

            {/* Profile Icon - Right Aligned */}
            <MDBNavbarItem className="ms-3">
              <Link to="/myprofile" className="nav-link">
                <MDBIcon fas icon="user" size="lg" />
              </Link>
            </MDBNavbarItem>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBContainer>
    </MDBNavbar>
  );
};

export default HeroSection;
